import Scroller from "../components/home/Scroller";
import Header from "../components/header/Header";
import '../components/header/header.css'

function HomePage() {
  return (
    <div>
      <Header />
      <div className="Home">
        <Scroller />
        <Scroller />
        <Scroller />
      </div>
    </div>
  )
}

export default HomePage;
